import "./Expense.css";
import ExpenseItem from "./ExpenseItems";

function Expense(props) {
  
  return (
    <div className="expenses">
     <ExpenseItem title = {props.eArray[0].title} date = {props.eArray[0].date} amount = {props.eArray[0].amount}></ExpenseItem>
      <ExpenseItem title = {props.eArray[1].title} date = {props.eArray[1].date} amount = {props.eArray[1].amount}></ExpenseItem>
      <ExpenseItem title = {props.eArray[2].title} date = {props[2].date} amount = {props[2].amount}></ExpenseItem>
      <ExpenseItem title = {props[3].title} date = {props[3].date} amount = {props[3].amount}></ExpenseItem>
    </div>
  );
}

export default Expense;
